import React from "react";
import { Navigate,Outlet, Route } from "react-router-dom";
import AuthHandler from "./AuthHandler";

export const PrivateRoute = ({...rest}) => {
    
  return (
    <Route
    {...rest}
    render = {(props) =>
    AuthHandler.loggedIn() ? <Outlet {...prop}/> : <Navigate to='/'/>
    }/>
    )
  }
